import React, { useState, useEffect } from "react"; 
import { Link } from "react-router-dom"; 
import { HashLink } from "react-router-hash-link"; // Import HashLink for smooth scrolling
import "./Pagrindinis_d.css";

const Main = () => {
    const [isMobile, setIsMobile] = useState(false); // State to track if the screen is mobile

    useEffect(() => {
        // Function to check screen width and set isMobile
        const handleResize = () => {
            setIsMobile(window.innerWidth <= 768); // If width is 768px or less, it's mobile
        };

        handleResize(); // Check the screen size on initial render
        window.addEventListener("resize", handleResize); // Add event listener for resizing

        return () => window.removeEventListener("resize", handleResize); // Cleanup on unmount
    }, []); // Empty array ensures this effect runs only once

    return (
        <main className="main">
            <div className="main_1_d">
                <div className="main_1_d_container">
                    <h1>Sveiki atvykę <br /> į mano pasaulį!</h1>
                    <img src="/nuotraukos/1_as.png" alt="Paveikslėlis" />
                    <p>Esu grafikos dizainerė ir iliustratorė.</p>
                </div>  
            </div>

            <div className="main_2_d">
                <h2 id="mano-darbai">Mano darbai</h2>
                <div className="work-list">
                    <Link to="/dizainoDarbai" className="work-item link-style">
                        <span>Grafinio dizaino darbai</span>
                        <button>Detaliau</button>
                    </Link>

                    <Link to="/maketai" className="work-item link-style">
                        <span>Maketai</span>
                        <button>Detaliau</button>
                    </Link>
                </div>
            </div>

            {isMobile ? (
                // For mobile: use HashLink to scroll to a section in the same page
                <HashLink smooth to="#main_3_d" className="link-style">
                    <section className="main_3_d">
                        <p className="mobile-text1">
                            Labas, mano vardas<br />Lėja.
                        </p>
                        <p className="mobile-text2">
                            Man labai patinka kūryba, todėl nenoriu savęs apibrėžti tik dviem žodžiais – geriau išbandyti ir mokėti daug dalykų vidutiniškai nei siekti tobulybės viename. Paklausite kodėl? Nes gebėjimas pritaikyti įvairius įgudžius suteikia lankstumo ir originalumo sprendžiant bet kokius iššūkius.
                        </p>
                    </section>
                </HashLink>
            ) : (
                // For desktop: use Link to navigate to the /apieMane page
                <Link to="/apieMane" className="link-style">
                    <section className="main_3_d">
                        <p>Mano pasaulis.</p>
                    </section>
                </Link>
            )}

            <svg width="287" height="296" viewBox="0 0 287 296" fill="none" xmlns="http://www.w3.org/2000/svg">
                <g clipPath="url(#clip0_421_86)">
                    <path d="M211.137 176.343C211.43 227.687 93.0132 226.716 90.4087 225.488C89.8401 225.231 89.1797 225.323 88.8312 225.891C88.5378 226.386 88.6845 227.193 89.2348 227.468C92.0411 228.769 94.9392 229.832 97.9106 230.639C98.5159 230.804 99.1579 230.437 99.323 229.832C99.488 229.227 99.1212 228.586 98.5159 228.421L98.5342 228.439Z" fill="#231F20"/>
                </g>
                <defs>
                    <clipPath id="clip0_421_86">
                        <rect width="287" height="295.2" fill="white"/>
                    </clipPath>
                </defs>
            </svg>

            {isMobile && (
                <p className="mobile-text3">
                    Todėl šiuo metu noriu pažinti žmones, atsidurti nepatogiose situacijose, kuriose galėčiau išbandyti save ir išmokti ką nors naujo. Kadangi dar studijuoju ir semiuosi dėstytojų išminties, nesu jokia ekspertė ir savo srityje, bet aš manau, kad svarbu bandyt ir klyst nei iš vis nebandyt.
                </p>
            )}
        </main>
    );
};

export default Main;
